import React from 'react';
import styled from 'styled-components';

const StyledGameOverButton = styled.button`
  box-sizing: border-box;

  margin: 0 0 20px 0;
  padding: 20px;
  min-height: 30px;
  width: 100%;
  border-radius: 20px;
  border: none;
  color: white;
  background: #333;
  font-family: Pixel, Arial, Helvetica, sans-serif;
  font-size: 1rem;
  outline: none;
  cursor: pointer;
`;

const GameOverButton = ({ callback }) => (
  <StyledGameOverButton> Game Over</StyledGameOverButton>
);

export default GameOverButton;
